import React from 'react';
import Header from '../components/Header';
import Portrait from '../components/portrait/Portrait';
import Contact from '../components/contact/Contact';

const Home = () => {
  return (
    <div>
      <Header />
      <main>
        <Portrait />
        <Contact />
        {/* Autres contenus du main */}
      </main>
    </div>
  );
};

export default Home;
